INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('4420e6ef-ef03-90f2-eddd-73db62badd89','2024-10-08T21:37:09+00:00','2023-11-17T20:51:46+00:00','Vitam omnem continent, neglegentur? Nam, ut sint illa vendibiliora, haec.','Latinis litteris mandaremus, fore ut hic noster labor.','199e674b-98fa-1441-2c8d-b91bcf25133f','6ce4068b-b8ef-6410-e92e-9ea044daacee','In Progress','f221fcd0-c52f-553e-bd89-64cf69c86ca4');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('23858573-6ead-3006-5d3c-4ea16695b143','2024-03-25T22:46:24+00:00','2023-12-09T03:41:09+00:00','Splendido nomine, virtutem autem nixam hoc honesto nullam requirere voluptatem atque ad beate vivendum se ipsa esse contentam. Sed possunt haec quadam ratione dici non necesse est. Tribus igitur modis.','De caelo est ad quiete vivendum, caritatem, praesertim cum omnino nulla sit causa peccandi.','30c30ce2-0245-e36c-3ec5-3345e9e34e2f','84921767-114e-2a99-49c5-d13e8f77ec27','Assigned','aa5e01f8-479d-99a8-ac3d-4b8ae043e2e4');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('849029de-a5f6-ac1e-8346-b6aeee60a35b','2024-07-14T13:31:43+00:00','2023-11-11T13:10:54+00:00','Est sola, quae nos exhorrescere metu non sinat. Qua.','Idcirco et hoc ipsum efficitur in amicitia, et amicitia cum voluptate vivatur. Quoniam autem id est vel summum bonorum vel ultimum vel extremum .','6d6dda53-500d-a5c0-2472-f353bd8f11c1','b92ed5ea-5029-9fad-daad-1d25f985db12','New','8d9d5b42-4aa5-e93d-eb12-d1cc093265c7');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('e061d98f-88f2-c875-ba8b-e3156a05da4e','2024-03-16T02:41:52+00:00','2024-05-19T19:27:59+00:00','Et contrariis studiis consiliisque semper utens nihil quieti videre, nihil tranquilli potest. Quodsi vitam omnem continent, neglegentur? Nam, ut sint opera, studio, labore meo.','Omnium rerum, quas ad beate vivendum se ipsa esse contentam. Sed possunt haec quadam ratione dici non modo fautrices fidelissimae, sed etiam cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo inventore veritatis et quasi architecto.','66c9caa4-6b57-9d97-906f-07f5f28e287a','b4020a50-cba1-0bb0-9218-07c5aec9fe2d','New','6dc03670-c3ea-0dd0-95cd-cb5c7b1a939c');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('2bb4c95c-5052-b93e-58eb-4fc815db7a9b','2024-05-07T11:00:12+00:00','2024-08-07T09:51:53+00:00','Si vita suppetet; et tamen, qui diligenter haec, quae vitam omnem continent, neglegentur? Nam, ut sint illa vendibiliora, haec uberiora certe.','Compluribus permulta dicantur, cur nec voluptas in bonis sit numeranda nec in discordia dominorum domus; quo minus animus.','92f225a5-94e1-9a62-99d1-33227da0d19c','ff794092-d8db-236f-9c6f-699d9ca6c3b6','Assigned','3f405e3d-599f-cb3b-a9b2-e2b8f8985bb0');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('d6b86bab-a228-b1cf-635a-010ade37e6de','2023-10-11T14:26:52+00:00','2024-06-27T09:49:04+00:00','Modis video esse a nostris non legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia transferrem. Sed id.','Et solida corpora ferri deorsum suo pondere ad.','ffb4e5cd-424e-e2a4-16f5-e4e2667ace5c','4e6f22c6-2486-4d38-d4f4-599776479d63','In Progress','3f405e3d-599f-cb3b-a9b2-e2b8f8985bb0');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('07651a3f-57ff-8077-f759-3ea5bad31e88','2024-06-08T16:05:44+00:00','2024-09-27T13:34:56+00:00','Quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non satis politus iis artibus, quas qui tenent, eruditi appellantur -- aut.','Nobis iniucundus labor. Iis igitur est difficilius satis facere, qui se Latina scripta.','3a1084ec-b697-b7c0-64ea-4af4528c5e96','669589b7-1180-c01e-687d-fff150709e47','In Progress','8462bab8-9eeb-5542-82c3-cb1d37c0a014');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('ea02d6f2-4cb2-12aa-c1c2-32ce66bd93a6','2024-02-15T00:17:35+00:00','2024-04-17T11:18:19+00:00','Regula et iudicio ab eadem illa individua et solida corpora ferri deorsum suo pondere ad lineam, numquam fore ut atomus altera alteram posset attingere.','Impetus quo pertineant non intellegamus, tu tam egregios viros censes tantas res gessisse sine causa? Quae fuerit causa, mox videro; interea hoc tenebo, si ob aliquam causam ista, quae sine dubio praeclara sunt, fecerint, virtutem iis per se ipsa esse.','b04cd62f-d0a6-f0a4-ec7d-45e4586a680d','effe6dce-661f-cbcd-bf91-1b30027372fc','New','5b988155-7469-6252-dab7-bcc41394920a');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('fb03793c-eece-a91d-c457-86cb1398c7ab','2024-02-29T16:49:19+00:00','2024-10-05T19:23:15+00:00','Quae essent et naturales et necessariae, alterum, quae vis sit, quae quidque efficiat, de materia disseruerunt, vim et causam efficiendi reliquerunt. Sed hoc commune.','Poetis evolvendis, ut ego et Triarius te hortatore facimus, consumeret, in quibus.','33de396b-1809-3649-4735-07b69d8491af','1f596437-be02-5a5e-32f3-5ab5b1cff9f6','New','163a4480-1335-f3f0-2cd1-c5c76cd06cc1');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('58a55c34-07c8-5760-0306-d3a3f3e459b3','2023-10-18T19:23:39+00:00','2024-06-30T22:57:00+00:00','Nos veriusque quam Stoici. Illi enim negant esse bonum iucunde vivere. Id qui in una virtute ponunt et splendore nominis.','Autem hanc omnem quaestionem de finibus.','70a81c90-0c24-d3bd-c8a9-8d35a9367115','6922cc8b-cc03-9647-9854-d478746cbc33','On Hold','2f7ff7be-e3f2-c495-2c9e-9228cf19f269');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('887328de-f701-422a-3c69-f5c306b5e637','2024-04-24T03:23:53+00:00','2024-10-01T12:28:53+00:00','Praetulerit ius maiestatis atque imperii. Quid? T. Torquatus, is qui consul cum Cn. Octavio.','Despicationes adversantur voluptatibus, sic amicitiae non modo fautrices fidelissimae, sed etiam cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo est.','a1f0fc17-d38b-3b75-1696-90c33c93e75d','515ef09a-9de7-4187-7ffd-7432012f2c8a','New','89b543df-5315-b9e6-2cc7-97c739d60921');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('862f82a8-4f48-d9c4-5cb5-5c0c17e64c58','2024-07-17T02:03:26+00:00','2024-05-08T02:10:57+00:00','Quo efficiantur ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut iis bonis erigimur, quae expectamus, sic.','In voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae dicta sunt ab iis quos probamus, eisque nostrum iudicium et nostrum scribendi ordinem adiungimus, quid habent, cur Graeca anteponant iis.','5e3a4b53-751b-4d05-d323-94c1aff0bb49','9d85c6b0-4d02-21fc-33d9-d6bf335e624b','Assigned','84104518-2dce-4552-e75a-62566a17d9b5');
INSERT INTO incidents(id,created_at,updated_at,short_description,description,configuration_item_id,company_id,state,assigned_to) VALUES ('c6045b3b-04e8-f357-46e6-74527aa0341e','2024-04-23T00:25:26+00:00','2024-07-24T07:40:27+00:00','Depravare videatur. Ille atomos quas appellat, id est incorruptis atque integris testibus, si infantes pueri, mutae etiam bestiae paene loquuntur magistra ac duce natura nihil esse prosperum nisi voluptatem, nihil asperum nisi.','Quid est, cur nostri a nostris non legantur? Quamquam, si plane sic verterem.','7147d009-6fec-1ed0-eada-28469ecb42c4','49e072b6-94ab-0195-b106-351c0f199eec','On Hold','23803d86-b4d2-a4b5-768a-0ea24dc2f6a4');

